import {Link} from 'react-router-dom'
import { useNavigate } from 'react-router-dom';
function MainPage() {

  const navigate = useNavigate();
  const handleSubmit = async (e) => {
    e.preventDefault();
    //const obj = { UserName: userLogin.UserName, password: userLogin.password}
    navigate(`/`);
  }



  return (
    <Container>
      <h3>Movies-Subscriptions Web Site</h3>
      <Button sx={{padding: 1, marginTop: 1 }} variant="outlined" size="small" type='submit' color="primary" onClick={handleSubmit}>Log Out</Button>

    </Container>
  );
}

export default MainPage;
